    false,nt"url": null,nt"notes": "This Data Release contains data from the
    U.S. Geological Survey (USGS) survey of the Oregon outer continental shelf (OCS)
    Floating Wind Farm Site in 2014. The bathymetry raster was generated from bathymetry
    data collected by USGS during the period from August 20 to September 1, 2014, using
    a Reson 7111 multibeam echosounder. The mapping mission collected bathymetry data
    from about 163 m to 566 m depths on the Oregon outer continental shelf. The acquisition
    was funded by the U.S. Bureau of Ocean Energy Management.",nt"license_title":
